function Post(props) {
    const rand = Math.random();
    const chooseName = rand > 0.5 ? "Ambili" : "Cheran";
    console.log("Random Value", rand);
    return (<div className="App">
        <h1> {
            props.author
        }</h1>
        <h2> {
            props.book
        }</h2>
    </div>);
}

export default Post;
